    chart.draw(data, options);
  }

function supports_html5_storage() {
  try {
    return 'localStorage' in window && window['localStorage'] !== null;
  } catch (e) {
    return false;
  }
}

function getCookie(c_name) {
  if (supports_html5_storage()) {
    try {
        return localStorage.getItem(c_name);
    } catch (e) {
        return false;
    }    
  } else  {
    if (document.cookie.length>0) {
      c_start=document.cookie.indexOf(c_name + "=");
      if (c_start!=-1) {
          c_start=c_start + c_name.length+1;
          c_end=document.cookie.indexOf(";",c_start);
          if (c_end==-1) c_end=document.cookie.length;
          return unescape(document.cookie.substring(c_start,c_end));
      }
    }
    return "";
  }
}

function setCookie(c_name,value,expiredays) {
  if (supports_html5_storage()) {
    try {
        localStorage.setItem(c_name, value);
        return;
    } catch (e) {
    }
  } else {
    var exdate=new Date();
    exdate.setDate(exdate.getDate()+expiredays);
    document.cookie=c_name+ "=" +escape(value)+
                     ((expiredays===null) ? "" : ";expires="+exdate.toUTCString());
  }
}

function setBoring(geno) {



  var understands = prompt('Going further will make a real change to SNPedia. It will set '+geno+' as magnitude=0 and repute=Good, which means boring. If you understand and want to make this change type: yes');

//      var understands = 'local';


  if (understands == 'yes') {

      realSetBoring(geno);
      alert('Done. If you add an exclation point, next time I wont ask again');

  } else if (understands == 'yes!') {

      setBoring = realSetBoring;
      setBoring(geno);


  } else if (understands == 'local') {

      setBoring = fakeSetBoring;
      setBoring(geno);

  } else {

      model.setGeno(geno, {
            'repute' : 'Good',
            'magnitude' : 0
            });
      updateTable();
      updateChart();
      alert('I only changed your local version');
  }
  return false;
}

function doGetGenoParts(geno) {

   var Geno = geno.charAt(0).toUpperCase() + geno.slice(1);
   $.ajax({
           url:      'http://www.snpedia.com/api.php?action=query&prop=revisions&titles='+Geno+'/criteria&rvprop=content&format=json',
           cache:    false,
           dataType: "jsonp",
           success:   function(data) {
              for (var i in data.query.pages) {
                var text = data.query.pages[i].revisions[0]["*"];
                var seen = {};
                var matchterms = text.match(/\b([rg]s\d+)\b/gi);
                if (matchterms) {
                    for (var idx in matchterms) {
                       chrom = matchterms[idx];
                       seen[chrom] = true;
                    }
                }
                matchterms = text.match(/\b(i\d+)\b/gi);
                if (matchterms) {
                    for (var idx in matchterms) {
                       chrom = matchterms[idx];
                       seen[chrom] = true;
                    }
                }

                var unique = new Array();
                for (var idx2 in seen) {
                    unique.push(idx2);
                }
                var textfilter = '('+geno+'|'+unique.join('|')+')';

                //console.log(textfilter);
                $('#textfilter').val(textfilter);
                updateGenos();

              }
            },
           error:   function(e, xhr) {
             console.log("failed");
             console.log(e);
             console.log(xhr);
           }
         });

}




if (typeof Array.prototype.push == 'undefined' ) {
    Array.prototype.push = function() {
     var i=0;
     var b=this.length;
     var a=arguments;
     for(i;i<a.length;i++) this[b+i]=a[i];
     return this.length;
   };
}


function showTags(p) {
     var o = new Array();
     if (p['tags']) {
         o.push('<div id="tags">');
         for(var u = 0; u < p['tags'].length; u++) {
             if (u > 0) {
                 o.push(' ');
             }
             o.push('<a class="label label-info taglink" href="#" >'+unescape(p['tags'][u])+'</a>');
         }
         o.push('</div>'); //tags
     }
     return o.join('');
}
function showClinVarDisease(p) {
  var o = new Array();
  if (p['clinvar_1']) {
      o.push('<span class="label label-inverse" href="#" >ClinVar');

      var msg = 'unset';
      if (       p['clinvar_1']=='5') {
        msg = '<span class="label label-important">Pathogenic</span>';
      } else if (p['clinvar_1']=='4') {
        msg = '<span class="label label-warning">Probable-pathogenic</span>';
      } else if (p['clinvar_1']=='3') {
        msg = '<span class="label label-success">Probable-non-pathogenic</span>';
      } else if (p['clinvar_1']=='2') {
        msg = '<span class="label label-success">Non-pathogenic</span>';
      } else if (p['clinvar_1']=='1') {
        msg = '<span class="label label-success">Untested</span>';
      } else if (p['clinvar_1']=='7') {
        msg = '<span class="label label-info">Histocompatibility</span>';
      } else if (p['clinvar_1']=='6') {
        msg = '<span class="label label-info">Drug-response</span>';
      } else if (p['clinvar_1']=='255') {
        msg = '<span class="label label-info">Other</span>';
      } else {
        msg = '<span class="label label-important">??</span>';
      }
      o.push(msg);

      if (p['clinvar_disease'] !== undefined) {
         var parts = p['clinvar_disease'].split(/;\s*/)
         for(var u = 0; u < parts.length; u++) {
           o.push('<a class="label label-inverse clinvar_link" href="#" >'+unescape(parts[u])+'</a> ');
         }
      }
      o.push('</span>');
  }
  return o.join('');
}

             if (numrefs < slidermin ) {

             }
             usebig = !magusecompact && !refsusecompact;

        }
        return usebig;

function freqsortfunc(a,b) {
   if (a.freq === undefined &&  b.freq === undefined) {
      return 0;
   } else if (a.freq === undefined) {
      return 1;
   } else if (b.freq === undefined) {
      return -1;
   } else if (a.freq == b.freq) {
      return 0;
   } else if (a.freq > b.freq) {
      return 1;
   } else {
      return -1;

   }
}

function gmafsortfunc(a,b) {
   if (a.gmaf === undefined &&  b.gmaf === undefined) {

      return -1;
   } else if (a.gmaf == b.gmaf) {
      return 0;
   } else if (a.gmaf > b.gmaf) {
      return 1;
   } else {
      return -1;

   }
}

 function chrom2int(chrom) {
    var chromint;
    if (chrom == 'X') {
       chromint = 23;
    } else if (chrom == 'Y') {
       chromint = 24;
    } else if (chrom == 'MT') {
       chromint = 25;
    } else if (chrom === undefined) {
       chromint = 26;
    } else {
       chromint = parseInt(chrom,10);
    }
    return chromint;
 }

 function pseudoposition(adict) {
    var scale = 1000000000;
    var out = chrom2int(adict['chrom']) * scale + adict['pos'];
    return out;
 }

 function locationsortfunc(a,b) {
    posa = pseudoposition(a);
    posb = pseudoposition(b);

    if (isNaN(posa) &&  isNaN(posb)) {
       return 0;
    } else if (isNaN(posa)) {
       return 1;
    } else if (isNaN(posb)) {
       return -1;
    } else if (posa > posb) {
       return 1;
    } else if (posa < posb) {
       return -1;
    } else {
       return 0;
    }

 }
 function datesortfunc(a,b) {
    if (a.rstime && a.genotime) {
      timea = Math.max(a.genotime, a.rstime);
    } else if (a.rstime) {
      timea = a.rstime;
    } else {
      timea = a.genotime;
    }

    if (b.rstime && b.genotime) {
      timeb = Math.max(b.genotime, b.rstime);
    } else if (b.rstime) {
      timeb = b.rstime;
    } else {
      timeb = a.genotime;
    }

    if (isNaN(timea) &&  isNaN(timeb)) {
       return 0;
    } else if (isNaN(timea)) {
       return -1;
    } else if (isNaN(timeb)) {
       return 1;
    } else if (timea > timeb) {
       return -1;
    } else if (timea < timeb) {
       return 1;
    } else {
       return 0;
    }

 }

function warmupData() {
    maxrefs = -Infinity;
    maxmag = -Infinity;
    minmag = Infinity;
    $.each(mygenos, function (i, p) {
        if (parseInt(p['numrefs'],10) > maxrefs) { maxrefs = parseInt(p['numrefs'],10); }


        var mag = 1;
        if (p['magnitude'] === undefined) {
            mag = 1;
        } else {
            mag = parseFloat(p['magnitude']);
        }




        if (mag > maxmag) { maxmag = mag; }
        if (mag < minmag) { minmag = mag; }

        // remember this for sorting
        p['original_index'] = i;

        // turn the array of tags into a hash for faster lookup
        p['tag'] = {};
        var thelen = 0;
        if ('tags' in p) thelen = p['tags'].length;
        for(var u = 0; u < thelen; u++) {
              tag = p['tags'][u];
              p['tag'][tag] = true;

        }

        // it would be better to pre-cook these in promethease, than to split on the semicolon
        if (p.clinvar_disease) {
            p['clinvar_tag'] = {};
            $.each(p.clinvar_disease.split('; '), function(i, label) {
                p['clinvar_tag'][label] = true;
            });
        }

        // compute it only once
        p['isASNP'] = isASNP(p);

        if (p.isASNP) {
            if (rsinfo[p.rsnum]) {
                var mags = $.map(rsinfo[p.rsnum], function (key) {return key.mag;});
                if (mags.length) {
                    p['maxmag'] = Math.max.apply(Math, mags);
                }
            }
        }
    });

}

function prepisWanted(viewtag) {



    var filterReputeGood = !$('input[name=filterGood]').is(':checked');
    var filterReputeBad = !$('input[name=filterBad]').is(':checked');
    var filterReputeNotSet = !$('input[name=filterNotSet]').is(':checked');
    var filterRepute = filterReputeGood || filterReputeBad || filterReputeNotSet;

    var filterSNPs = !$('input[name=filterSNPs]').is(':checked');
    var filterGenosets = !$('input[name=filterGenosets]').is(':checked');






    var filterSNPs = !$('input[name=filterSNPs]').is(':checked');
    var filterGenosets = !$('input[name=filterGenosets]').is(':checked');
    var filterclinvar = false;

    var textfilter = $( '#textfilter' ).val( );
    var filterclinvar_disease = $( '#' ).val( );
    //var filterclinvar = false;
    //var clinsigwanted = Object();


    //console.log(clinsigwanted);
    if ( clinsigwanted.length ) {
        console.log('allow filter clinvar');
        filterclinvar = true;

        if (clinsigwanted['999']) {
           filterclinvar = false;
           console.log('allowing all, and disabling filter clinvar');
        }
    }


    var doChrRegex = false;
    if (textfilter) {

       if ( textfilter.match(/\/CLNSIG=/) ) {
          var clinsigmatch = textfilter.match(/\/CLNSIG=(\S+)/);
          if (clinsigmatch) {
            filterclinvar = true;
            clinsigwanted = clinsigmatch[1].split(/,/)
          }
       }
       if ( textfilter.match(/\/COUNT.?=\d+/) ) {
          var match_count = textfilter.match(/\/COUNT(.?=)(\d+)/);
          if (match_count) {
            filter_count = true;
            filter_count_OP = match_count[1];
            filter_count_N = match_count[2];
          }
       }

       if ( textfilter.match(/^\/\w+/) ) {
          textfilter = textfilter.replace(/\s*\/\w+=?\S*/g,'');
       }

       if ( textfilter.match(/^chr/) ) {
           doChrRegex = true;
           var chrom = undefined;
           var startpos = undefined;
           var endpos = undefined;
           var matchchrom = textfilter.match(/^chro?m?\s*([0-9xymt]+)/i);
           if (matchchrom) {
             chrom = matchchrom[1].toUpperCase();
             var matchanchor = textfilter.match(/^chro?m?\s*[0-9xymt]+\s*:\s*(\d+)/);
             if (matchanchor) {

                  // found chr 3:5000-8000

                  startpos = parseInt(matchanchor[1], 10);
                  var matchrange = textfilter.match(/^chro?m?\s*[0-9xymt]+\s*:\s*\d+\s*[-:](\d+)/i);
                  if (matchrange && matchrange[1]) {
                     thepos = parseInt(matchrange[1], 10);
                     if (thepos > startpos) {
                         endpos = thepos;
                     }

                  } else {
                     // found chr 3:5000+3000
                     var matchplus = textfilter.match(/^chro?m?\s*[0-9xymt]+\s*:\s*\d+\s*\+(\d+)/i);
                     if (matchplus && matchplus[1]) {
                         thepos = parseInt(matchplus[1], 10);
                         endpos = startpos+thepos;
                     }
                  }
             }
           }
       }
    }



    var all_allowed = clinsigwanted['999']
    var myinMagRange = prepareinMagRange();
    var myinRanges = prepinRanges();

    var isWantedCheck = function (p) {

        if(viewtag && !p['tag'][viewtag]) return false;

        // piechart
        if (!(viewtag_clinvar_disease === undefined)) {
          if(viewtag_clinvar_disease) {
             var keyname='clinvar_disease';
             var keep = false;
             if (p[keyname]) {
                 var parts = p[keyname].split(/;\s*/);
                 for(var u = 0; u < parts.length; u++) {
                   var v = parts[u];
                   if (v == viewtag_clinvar_disease) {
                       keep = true;
                   }
                 }
             }
             if (!keep) { return false; }
          }
        }



        if (!all_allowed) {
              if (!clinsigwanted[p['clinvar_1']]) {
                 return false;
              }
        }

        if (filterRepute) {
           var repute = p['repute'];
           if (repute == 'Good' && filterReputeGood) return false;
           if (repute == 'Bad' && filterReputeBad) return false;
           if (repute === undefined && filterReputeNotSet) return false;
        }

        if (filter_count_N) {
           if (p.count < filter_count_N) return false;
        }

        if (filterclinvar) {
            console.log('filterclinvar');
            var clinsig = p['clinvar_1'];
            console.log(clinsig);
            var match = false;
            if (!(clinsig === undefined)) {
                 if (clinsigwanted[String(clinsig)]) {
                         match = true;
                 }
            }
            if (!match) return false;
        }


        if (textfilter) {
           var match;
           if ( doChrRegex ) {
               match = true;
               if (match && p.chrom != chrom) match = false;
               if (match && p.pos < startpos) match = false;
               if (match && p.pos > endpos && endpos > startpos) match = false;
               if (!match) return false;
           } else {
               match = false;
               var patt=new RegExp(textfilter,'i');
               if (p.rstext && patt.test(p.rstext)) match = true;
               if (!match && p.title && patt.test(p.title)) match = true;

               if (!match && p.clinvar_disease) {
                 var clinvar_diseases = p.clinvar_disease.split(/;\s*/)
                 for(var u = 0; !match && u < clinvar_diseases.length; u++) {
                    if (patt.test(clinvar_diseases[u])) match = true;
                 }
               }

               if (!match && p.genobody && patt.test(p.genobody)) match = true;
               if (!match && p.genosummary && patt.test(p.genosummary)) match = true;
               if (!match && p.gene && patt.test(p.gene)) match = true;
               if (!match && p.dbsnp && patt.test(p.dbsnp)) match = true;
               if (!match && p.tags) {
                   var tagidx;
                   for (tagidx in p['tags']) {
                      if (!match && patt.test(p['tags'][tagidx])) match = true;
                   }
               }
               if (!match) return false;
           }
        }

        if (p['isASNP']) {
          if (filterSNPs) return false;
          if (myinRanges(p)) return true;
        } else {
              if (filterGenosets) return false;
              if (myinMagRange(p)) {return true;}
        }
        return false;
    };
    return isWantedCheck;
}

function genosHTML() {

  var blocks = new Array();
  var maxitems = parseInt($( '#maxitems' ).val( ),10);
  if (!maxitems) {
     $( '#maxitems' ).val( 10 );
     maxitems = 10;
  }

  var count = 0;
  var skipped = 0;
  var missed = 0;
  var masked = 0;

  var myisWanted = prepisWanted(viewtag);
  var myinRanges = prepinRanges();

  model.each(function (i, p) {
      var skip = 0;
      if (count >= maxitems) {
         skipped++;
         skip++;
      }
      if(viewtag && !p['tag'][viewtag]) return;
  
      var wanted = myisWanted(p);
      if (!wanted) return;
  
      if (clinsigwanted) {
       if (!clinsigwanted['999']) {
          if (!clinsigwanted[p['clinvar_1']]) {
              return;
          }
       }
      } else {
              console.log('  early undef');
      } 
  
  
      if (p['isASNP']) {
          if (!skip) {
             if (myinRanges(p)) {
                 blocks.push(generateRsFormat(p));
                 count++;
             }  else {
                 masked++;
             }
          } else {
             missed++;
          }
      } else if(!(p['title']===undefined)) {
  
          if (!skip) {
             if (myinRanges(p)) {
                 blocks.push(generateGenosetFormat(p));
                 count++;
             } else {
                 masked++;
             }
          } else {
             missed++;
          }
        }
  });


  if (missed) {
      blocks.push('<div id="footerBox">');
      blocks.push('<div id="footer"  class="boxresult">');
      blocks.push('<button class="tooltipped" title="Fast way to allow twice as many visible rows" id="more" onclick="wantmore();">2x more</button>');
      blocks.push('</div>');
      blocks.push('</div>');
  }
  
  $( "#num_missed" ).val( missed );
  $( "#num_count" ).val( count );
  
  return blocks.join('');
}

function setSort(name) {
var reverse = false;
var sortf = magsortfunc;
var suffix = '-rev';
if        (name.indexOf('magnitude') === 0)  { sortf = magsortfunc;
} else if (name.indexOf('maxmagnitude') === 0)  { sortf = maxmagsortfunc;
} else if (name.indexOf('frequency') === 0)  { sortf = freqsortfunc;
} else if (name.indexOf('gmaf') === 0)  { sortf = gmafsortfunc;
} else if (name.indexOf('references') === 0) { sortf = refsortfunc;
} else if (name.indexOf('location') === 0)   { sortf = locationsortfunc;
} else if (name.indexOf('mod-date') === 0)   { sortf = datesortfunc;
}

if (name.indexOf(suffix, name.length - suffix.length) !== -1) reverse = true;

model.setFlag('reverse', reverse);
model.setSort(sortf);

updateTable();
return false;
}

function uintToString(uintArray) {

    var encodedString = String.fromCharCode.apply(null, uintArray),
        decodedString = decodeURIComponent(escape(encodedString));
    return decodedString;
}

function decompressString(s) {
   var compressData = atob(s);
   var compressData2 = compressData.split('').map(function(e) {return e.charCodeAt(0)});
   var inflate = new Zlib.Inflate(compressData2);
   var output = JSON.parse(uintToString(inflate.decompress()));
   return output;
}

chrom": "10", "rstext": "rs4244285 is a SNP in the CYP2C19 gene, potentially encoding the CYP2C19*2 variant. This variant is the most common reason for poor metabolism of compounds like mephenytoin (an anti-convulsant), some antidepressants, the anti-platelet drug Plavix, and some drugs used for ulcer conditions of various types. The risk allele is rs4244285(A). As a nonfunctioning CYP2C19, this variant would be expected to be a poor metabolizer of several commonly prescribed drugs, including anti-ulcer drugs like omeprazole (trade names Losec and Prilosec), esomeprazole (trade name Nexium), and lansoprazole (trade name Prevacid). In Caucasians, SNPs in CYP2C19 are relatively rare (in contrast to SNPs in CYP2D6), but SNPs in this gene are common in Asians. Ulcer treatment with omeprazole to reduce Helicobacter pyl...", "url": "http://www.snpedia.com/index.php/rs4244285(A;A)", "rstime": 20140331235028, "geno": "(A;A)", "magnitude": 4.0, "gene": "CYP2C19"}, {"orientation": "plus", "clinvar_1": "255", "color": "#FF9090", "rsnum": "rs1061235", "pos": "29913298", "freqcolor": "#686868", "clinvar_disease": "Carbamazepine hypersensitivity", "numrefs": 1, "title": "rs1061235(A;T)", "genosummary": "26% risk of bad reaction to anti-epileptic carbamazepine", "repute": "Bad", "tags": ["Carbamazepine", "ClinVar"], "effect": "26% risk of bad reaction to anti-epileptic carbamazepine", "magcolor": "#FF9090", "gmaf": 0.072080000000000005, "chrom": "6", "rstext": "rs1061235(T) serves as a proxy for the HLA-A*3101 allele. The HLA-A*3101 allele, found in about 2 - 5% of Northern Europeans, is significantly associated with carbamazepine hypersensitivity syndrome, with odds ratios above 10. The presence of this HLA allele increases the risk from 5% to 26%, whereas its absence reduces the risk from 5% to 4%.  [GWAS:None]", "url": "http://www.snpedia.com/index.php/rs1061235(A;T)", "rstime": 20140401171637, "geno": "(A;T)", "magnitude": 4.0, "gene": "HLA-A"}, {"orientation": "plus", "color": "#FF9090", "rsnum": "rs1333049", "newflags": "<a href='http://www.snpedia.com/index.php/Ambiguous_flip'>ambig</a><br/>", "pos": "22125503", "frequency": "20.4%", "freqcolor": "#F0B2F0", "numrefs": 79, "title": "rs1333049(C;C)", "genosummary": "1.9x increased risk for CAD", "repute": "Bad", "tags": ["Coriell Personalized Medicine Collaborative", "Coronary artery disease", "Heart disease", "Stroke"], "effect": "1.9x increased risk for CAD", "magcolor": "#FF9090", "gmaf": 0.43340000000000001, "freq": 20.399999999999999, "chrom": "9", "rstext": "rs1333049 has been reported in a large study to be associated with heart disease, in particular, coronary artery disease. The risk allele (oriented to the dbSNP entry) is most likely (C); the odds ratio associated with heterozygotes is 1.47 (CI 1.27-1.70), and for homozygotes, 1.9 (CI 1.61-2.24). This SNP has also been reported to have the highest association of any SNP studied in a subsequent experiment conducted with the resources of the German MI [Myocardial Infarction] Family Study. The initial studies were conducted on Caucasian populations. A subsequent study of Japanese and Korean patients has also found rs1333049 to be associated with increased coronary artery disease risk, with roughly similar odds ratios. A long-term study of a cohort of 769 individuals finds that the rs1333049(C...", "url": "http://www.snpedia.com/index.php/rs1333049(C;C)", "rstime": 20140331230536, "geno": "(C;C)", "magnitude": 4.0}, {"title": "gs141", "color": "#FFFFD0", "tags": ["23andMe/SNPs", "APOE", "Alzheimer's disease"], "genotime": 20121127014330, "genosummary": "2x risk of Alzheimer's disease", "magcolor": "#FF9090", "magnitude": 3.5, "genobody": "You carry one APOE-\u03b53 allele and one APOE-\u03b54 allele. This results in 2x increased relative risk of Alzheimer's disease. For non-caucasians the risk is increased, but SNPedia has not yet seen any reliable estimates. This is based on *rs429358(C;T) *rs7412(C;C)", "repute": "Bad", "imgurl": null}, {"title": "gs152", "color": "#FFFFD0", "tags": ["CYP2C19", "Clopidogrel", "Plavix"], "genotime": 20131019172612, "genosummary": "CYP2C19 Poor Metabolizer", "magcolor": "#FF9090", "magnitude": 3.5, "genobody": "CYP2C19 Poor Metabolizer. Your body breaks down some medicines more slowly than most people. As a result, you may need a lower than average dosage of the medicines metabolized by CYP2C19 in order to decrease adverse effects, or a higher than average dose to increase efficacy of drugs that require metabolization by CYP2C19 to become active. One example of a drug requiring bioconversion by CYP2C19 is Clopidogrel (Plavix); CYP2C19 poor metabolizers may require higher Clopidogrel dosing or the use of another thienopyridine such as prasugrel.[http://jama.ama-assn.org/cgi/content/full/302/8/849]", "repute": "Bad", "imgurl": null}, {"orientation": "plus", "color": "#FF9090", "rsnum": "rs12777823", "pos": "96405502", "frequency": "1.8%", "freqcolor": "#FF7777", "numrefs": 3, "title": "rs12777823(A;A)", "genosummary": "Avoid Plavix, higher risk for adverse cardiovascular events. CYP2C19 poor metabolizer.", "genobody": "poor metabolizer of several popular medicines; Neighboring rs4244285 is a more reliable predictor, but this genotype is linked to being a poor metabolizer of several popular medicines; patients prescribed Plavix (Clopidogrel) have higher risk for adverse cardiovascular events.", "repute": "Bad", "tags": ["Clopidogrel"], "effect": "Avoid Plavix, higher risk for adverse cardiovascular events. CYP2C19 poor metabolizer.  poor metabolizer of several popular medicines; Neighboring rs4244285 is a more reliable predictor, but this genotype is linked to being a poor metabolizer of several popular medicines; patients prescribed Plavix (Clopidogrel) have higher risk for adverse cardiovascular events.", "magcolor": "#FF9090", "gmaf": 0.2213, "freq": 1.8, "chrom": "10", "rstext": "JAMA rs12777823 and rs4244285 implicated in platelet response to clopidogrel  [PharmGKB:Curated A GWAS found this variant (rs12777823) was the most significantly associated SNP with clopidogrel response. This SNP was in strong linkage disequilibrium with 12 further SNPs within the CYP2C18-CYP2C19-CYP2C9-CYP2C8 cluster (rs12777823; rs10109204; rs2025445; rs1326837; rs717238; rs2860838; rs2860903; rs9332105; rs9332113; rs12572351; rs10509679; rs1934951; rs1934680) and also with the loss-of-function variant CYP2C19*2 (rs4244285). Further findings in this study showed that the CYP2C19*2 genotype accounted for most of all the initially found association with diminished platelet response to clopidogrel.]", "url": "http://www.snpedia.com/index.php/rs12777823(A;A)", "rstime": 20140331235010, "geno": "(A;A)", "magnitude": 3.5, "gene": "LOC100130970"}, {"orientation": "minus", "color": "#FF9090", "rsnum": "rs738409", "newflags": "<a href='http://www.snpedia.com/index.php/Ambiguous_flip'>ambig</a><br/>", "pos": "44324727", "frequency": "55.4%", "freqcolor": "#F0D0F0", "numrefs": 86, "title": "rs738409(G;G)", "genosummary": "higher odds of alcoholic liver disease, increased liver fat", "genobody": "While found in 55%+ of all people, alcohol seems to be 3x more damaging to your liver than typical. 5x higher risk for developing fatty liver, and 6x risk of fibrosis. news", "repute": "Bad", "tags": ["Nonalcoholic fatty liver disease"], "effect": "higher odds of alcoholic liver disease, increased liver fat  While found in 55%+ of all people, alcohol seems to be 3x more damaging to your liver than typical. 5x higher risk for developing fatty liver, and 6x risk of fibrosis. news", "magcolor": "#FF9090", "gmaf": 0.28420000000000001, "freq": 55.399999999999999, "chrom": "22", "rstext": "rs738409 is a SNP in the PNPLA3 gene. In all HapMap populations the most common allele is a is a G on the positive strand. In the scientific literature, the less common C allele is considered normal, and linked to lower liver fat content. In a Mestizo population, rs738409 is strongly associated with alcoholic liver disease and clinically evident alcoholic cirrhosis (unadjusted odds ratio 2.25, p=1.7 x 10(-10); ancestry-adjusted OR 1.79, p=1.9 x 10(-5)). rs738409(G) increased quantitative measures of liver fat content nature Nonalcoholic fatty liver disease. fat content 2x for rs738409(G;G) rs738409(G) (I148M) was strongly associated with increased hepatic fat levels (P = 5.9 times 10-10)  [PharmGKB:Curated In a genome-wide association study this SNP in PNPLA3 gene was strongly associated w...", "url": "http://www.snpedia.com/index.php/rs738409(G;G)", "rstime": 20140401042055, "geno": "(G;G)", "magnitude": 3.1000000000000001, "gene": "PNPLA3"}, {"orientation": "plus", "color": "#FF9090", "rsnum": "rs10033464", "pos": "111720761", "frequency": "15.9%", "freqcolor": "#FFB3B3", "numrefs": 10, "title": "rs10033464(G;T)", "genosummary": "1.28x increased risk of Atrial Fibrillation and cardioembolic stroke.", "genobody": "This is one copy of a mutant version (and one of the normal version) which slightly affects the formation of the heart and makes people slightly more likely to get Atrial Fibrillation (quivering of the top chambers of the heart caused by chaotic electrical signals) and slightly more likely to have a cardioembolic stroke (blocked blood flow to the brain). But also check the other SNP nearby (rs2200733) which affects Atrial Fibrillation even more. 23andMe gave this a 4 star confidence rating as it has been heavily studied. It has been confirmed in Europeans.", "repute": "Bad", "tags": ["Atrial fibrillation", "Stroke"], "effect": "1.28x increased risk of Atrial Fibrillation and cardioembolic stroke.  This is one copy of a mutant version (and one of the normal version) which slightly affects the formation of the heart and makes people slightly more likely to get Atrial Fibrillation (quivering of the top chambers of the heart caused by chaotic electrical signals) and slightly more likely to have a cardioembolic stroke (blocked blood flow to the brain). But also check the other SNP nearby (rs2200733) which affects Atrial Fibrillation even more. 23andMe gave this a 4 star confidence rating as it has been heavily studied. It has been confirmed in Europeans.", "magcolor": "#FF9090", "gmaf": 0.16350000000000001, "freq": 15.9, "chrom": "4", "rstext": "Two SNPs from chromosome 4q25, rs2200733 and rs10033464, were found to be associated with atrial fibrillation in a study of both European and Asian populations. The odds ratio associated with one or more copies of either risk allele was ~1.4x. In 1,661 Icelandic ischemic stroke samples and two large European replication sets combined, rs10033464 was associated with cardioembolic stroke (CES) (odds ratio 1.27, p = 6.1 x 10e-4). rs2200733 and rs10033464 are strongly associated with AF in four cohorts of European descent. Variation in the 4q25 chromosomal locus predicts atrial fibrillation after coronary artery bypass graft surgery. Chromosome 4q25 variants and atrial fibrillation recurrence after catheter ablation. Common variants in KCNN3 are associated with lone atrial fibrillation. Associ...", "url": "http://www.snpedia.com/index.php/rs10033464(G;T)", "rstime": 20140331182519, "geno": "(G;T)", "magnitude": 3.0}, {"orientation": "plus", "color": "#FF9090", "rsnum": "rs2383206", "pos": "22115026", "frequency": "24.6%", "freqcolor": "#FFC3C3", "numrefs": 30, "title": "rs2383206(G;G)", "genosummary": "1.7x increased risk for heart disease", "genobody": "23andMe blog People with this genotype and a long history of high blood sugar are at 7x risk of CAD", "repute": "Bad", "tags": ["Coronary artery disease", "Diabetes", "Heart disease"], "effect": "1.7x increased risk for heart disease  23andMe blog People with this genotype and a long history of high blood sugar are at 7x risk of CAD", "magcolor": "#FF9090", "gmaf": 0.49170000000000003, "freq": 24.600000000000001, "chrom": "9", "rstext": "rs10757274 and rs2383206 can significantly increase the risk of heart diseaseAbout one in every four Caucasians are thought to carry the variants, and their risk of coronary heart disease is increased by 30 to 40%. rs10757278] in the same region has been linked to diabetes The chromosomal region where these SNPs are located is 9p21, and has no known genes. a [http://suicyte.wordpress.com/2007/05/26/soul-searching-i/ blog post about investigating rs10757274 and rs2383206 This SNP was also associated with increased risk for coronary artery disease in a Korean population. Also found to be significant in a study of 416 Italian myocardial infarction patients. A study of 1,000+ patients with early-onset angiographic coronary artery disease (CAD) concluded that rs2383206(G) was associated with an...", "url": "http://www.snpedia.com/index.php/rs2383206(G;G)", "rstime": 20140331230520, "geno": "(G;G)", "magnitude": 3.0, "gene": "CDKN2BAS"}]);

nother study () has concluded that almost individuals carrying the A111T variant can trace ancestry back to a single person who most likely lived at least 10,000 years ago. This SNP is one of three from the SLC24A5 gene that can be analyzed to categorize the ancestry of a person as either European, African, or Asian, based on a 2009 study. The 3 SNPs are: * rs1426654 * rs25...", "url": "http://www.snpedia.com/index.php/rs1426654(A;G)", "rstime": 20140402121211, "geno": "(A;G)", "magnitude": 2.5, "gene": "SLC24A5"}, {"orientation": "plus", "clinvar_1": "5", "color": "#FF9090", "rsnum": "rs17822931", "pos": "48258198", "frequency": "0.9%", "freqcolor": "#FF6969", "clinvar_disease": "Apocrine gland secretion; Axillary odor; Colostrum secretion", "numrefs": 11, "title": "rs17822931(T;T)", "genosummary": "Dry earwax. No body odour. Likely Asian ancestry. Reduced colostrum.", "genobody": "This is what causes most Asians to have dry flaky earwax instead of wet earwax. It is also what causes Asians to not have body odour and not need to use deodorant. It suggests Asian ancestry, although it can also occur in white people. Unfortunately it also reduces or prevents the production of colostrum when breast feeding.", "repute": "Good", "tags": ["23andMe/SNPs", "Breast cancer", "ClinVar", "Earwax", "Family Tree DNA Factoids"], "effect": "Dry earwax. No body odour. Likely Asian ancestry. Reduced colostrum.  This is what causes most Asians to have dry flaky earwax instead of wet earwax. It is also what causes Asians to not have body odour and not need to use deodorant. It suggests Asian ancestry, although it can also occur in white people. Unfortunately it also reduces or prevents the production of colostrum when breast feeding.", "magcolor": "#FF9090", "gmaf": 0.3085, "freq": 0.90000000000000002, "chrom": "16", "rstext": "rs17822931, also known as c.538G&gt;A or G180R, is a SNP in the ATP-binding cassette, sub-family C (CFTR/MRP), member 11 ABCC11 gene. The ABCC11 protein helps transport small molecules across apical membranes such as those in apocrine secretory cells. This SNP determines wet vs dry earwax as well as sweat production, and it is also associated with lipid secretion. It is commonly (T;T) for Asians and (C;C) for Europeans and Africans. A study of deodorant usage in a large (17,000+) population showed that rs17822931(T;T) individuals were at least 5-fold less likely to use deodorant, consistent with them being 'genotypically nonodorous'. Although not statistically significant, there was some evidence for a heterozygote effect, implying that individuals with a (C;C) genotype for this SNP were l...", "url": "http://www.snpedia.com/index.php/rs17822931(T;T)", "rstime": 20140402165552, "geno": "(T;T)", "magnitude": 2.5, "gene": "ABCC11"}, {"orientation": "plus", "clinvar_1": "2", "color": "#FF9090", "rsnum": "rs4680", "pos": "19951271", "frequency": "24.8%", "freqcolor": "#FFC3C3", "clinvar_disease": "CATECHOL-O-METHYLTRANSFERASE POLYMORPHISM", "numrefs": 251, "title": "rs4680(A;A)", "genosummary": "(worrier) advantage in memory and attention tasks", "genobody": "Little or no response to modafinil. You are more difficult to hypnotise. Placebo is more effective http://www.nytimes.com/2013/02/10/magazine/why-can-some-kids-handle-pressure-while-others-fall-apart.html?ref=magazine&pagewanted=all", "repute": "Good", "tags": ["23andMe/SNPs", "Attention deficit hyperactivity disorder", "Breast cancer", "Cannabis", "ClinVar", "Depression", "Endometrial cancer", "Fibromyalgia", "Modafinil", "NutraHacker SNPs", "Pain", "Paroxetine", "Personality", "Pharma DMET", "Placebo", "Post-traumatic stress disorder", "Schizophrenia", "Yasko Methylation"], "effect": "(worrier) advantage in memory and attention tasks  Little or no response to modafinil. You are more difficult to hypnotise. Placebo is more effective http://www.nytimes.com/2013/02/10/magazine/why-can-some-kids-handle-pressure-while-others-fall-apart.html?ref=magazine&pagewanted=all", "magcolor": "#FF9090", "gmaf": 0.39029999999999998, "freq": 24.800000000000001, "chrom": "22", "rstext": "rs4680 (Val158Met) is a well studied SNP in the COMT gene. 23andMe blog summarizes them as *rs4680(A) = Worrier. Met, more exploratory, lower COMT enzymatic activity, therefore higher dopamine levels; lower pain threshold, enhanced vulnerability to stress, yet also more efficient at processing information under most conditions *rs4680(G) = Warrior. Val, less exploratory, higher COMT enzymatic activity, therefore lower dopamine levels; higher pain threshold, better stress resiliency, albeit with a modest reduction in executive cognition performance under most conditions Roughly speaking, the predominant wisdom (known colloquially as the warrior/worrier hypothesis; summary at ) posits that people with Val alleles have increased COMT activity and lower prefrontal extracellular dopamine compar...", "url": "http://www.snpedia.com/index.php/rs4680(A;A)", "rstime": 20140403100131, "geno": "(A;A)", "magnitude": 2.5, "gene": "COMT"}, {"orientation": "plus", "color": "#FF9090", "rsnum": "rs10757278", "pos": "22124477", "frequency": "25.9%", "freqcolor": "#FFC4C4", "numrefs": 72, "title": "rs10757278(G;G)", "genosummary": "1.6x risk for Heart Attack; 1.3x risk for Abdominal Aortic Aneurysm and Brain Aneurysm.", "genobody": "Two copies of an SNP that increases risk of Myocardial Infarction (Heart Attack) and other Coronary Heart Disease. It has been shown that regularly eating raw vegetables and fruit can reduce the risk to the same level as people without any copies of this SNP. This SNP also increases risk of abdominal aortic aneurysm (weakened artery to the abdomen and legs), and brain aneurysm (weakened artery to the brain).", "repute": "Bad", "tags": ["23andMe/SNPs", "Abdominal aortic aneurysm", "Aneurysm", "Breast cancer", "Coronary artery disease", "Diabetes", "Heart disease", "Intracranial Aneurysm", "Myocardial infarction", "Stroke"], "effect": "1.6x risk for Heart Attack; 1.3x risk for Abdominal Aortic Aneurysm and Brain Aneurysm.  Two copies of an SNP that increases risk of Myocardial Infarction (Heart Attack) and other Coronary Heart Disease. It has been shown that regularly eating raw vegetables and fruit can reduce the risk to the same level as people without any copies of this SNP. This SNP also increases risk of abdominal aortic aneurysm (weakened artery to the abdomen and legs), and brain aneurysm (weakened artery to the brain).", "magcolor": "#FF9090", "gmaf": 0.4279, "freq": 25.899999999999999, "chrom": "9", "rstext": "This SNP, rs10757278, is one of several clustered together in a region of chromosome 9 that has been linked to increased risk for heart disease and potentially diabetes. The overall estimate of heart disease cases that may involve this SNP (or related ones nearby) is said to be 20-30%. The risk allele, rs10757278(G), shows an increased association for myocardial infarctions ('MI'; heart attacks) both in general and more specifically in so-called early onset MI. The odds ratio relative to rs10757278(A:A) 'noncarrier' individuals for rs10757278(G;G) individuals is 1.64 (CI: 1.47-1.82), and for carriers of one risk allele, i.e. rs10757278(A;G) individuals, 1.26 (CI: 1.16-1.36). For early onset MI, the odds are slightly higher; homozygote rs10757278(G;G) individuals have an odds ratio of 2.02 ...", "url": "http://www.snpedia.com/index.php/rs10757278(G;G)", "rstime": 20140331230532, "geno": "(G;G)", "magnitude": 2.5}, {"orientation": "plus", "color": "#FF9090", "rsnum": "rs1799971", "pos": "154360797", "frequency": "27.4%", "freqcolor": "#FFC7C7", "clinvar_disease": "Reclassified - variant of unknown significance", "numrefs": 24, "title": "rs1799971(A;G)", "genosummary": "stronger cravings for alcohol. if alcoholic, naltrexone treatment 2x more successful", "repute": "Bad", "tags": ["23andMe/SNPs", "Alcoholism", "Cannabis", "ClinVar", "Codeine", "Drugbank", "Morphine", "Naltrexone"], "effect": "stronger cravings for alcohol. if alcoholic, naltrexone treatment 2x more successful", "magcolor": "#FF9090", "gmaf": 0.19009999999999999, "freq": 27.399999999999999, "chrom": "6", "rstext": "The rs1799971(G) allele in exon 1 of the mu opioid receptor OPRM1 gene causes the normal amino acid at residue 40, asparagine (Asn), to be replaced by aspartic acid (Asp). In the literature this SNP is also known as A118G, N40D, or Asn40Asp. Carriers of at least one rs1799971(G) allele appear to have stronger cravings for alcohol than carriers of two rs1799971(A) alleles, and are thus hypothesized to be more at higher risk for alcoholism. However, subsequent research results are mixed, and there are other studies both agreeing or disagreeing with this finding Among 200+ alcoholics treated with naltrexone, rs1799971(G) carriers receiving the drug (even without behavioral intervention) had an increased percentage of days abstinent (p = .07) and a decreased percentage of heavy drinking days (...", "url": "http://www.snpedia.com/index.php/rs1799971(A;G)", "rstime": 20140401013831, "geno": "(A;G)", "magnitude": 2.5, "gene": "OPRM1"}, {"orientation": "plus", "color": "#FF9090", "rsnum": "rs613872", "pos": "53210302", "frequency": "27.4%", "freqcolor": "#FFC7C7", "numrefs": 10, "title": "rs613872(G;T)", "genosummary": "~5 fold higher risk for Fuchs' dystrophy, a corneal disorder", "repute": "Bad", "tags": ["Fuchs' dystrophy"], "effect": "~5 fold higher risk for Fuchs' dystrophy, a corneal disorder", "magcolor": "#FF9090", "gmaf": 0.083099999999999993, "freq": 27.399999999999999, "chrom": "18", "rstext": "rs613872 is an intronic SNP in the transcription factor 4 TCF4 gene on ch18q21.2. This GWAS study reported in 2010 the association between several independent TCF4 SNPs and Fuchs' dystrophy, including rs613872. They estimated the population attributable risk at about 60% for the rs613872 risk genotypes; in other words, barring other interactions, the relatively common minor allele rs613872(G) is associated with over half of all reported cases of Fuchs' dystrophy in the patient group studied. That does not mean it is causative, though; after all, ~30% of the CEU population carries this allele but the fraction developing Fuchs' dystrophy is less than 5%, so most rs613872(G) carriers are not diagnosed with the disorder. rs613872 was found to be associated with Fuchs' dystrophy based on a stud...", "url": "http://www.snpedia.com/index.php/rs613872(G;T)", "rstime": 20140401030514, "geno": "(G;T)", "magnitude": 2.5, "gene": "TCF4"}, {"orientation": "plus", "clinvar_1": "255", "color": "#FF9090", "rsnum": "rs601338", "pos": "49206674", "frequency": "30.4%", "freqcolor": "#FFCBCB", "clinvar_disease": "SECRETOR/NONSECRETOR POLYMORPHISM; Norwalk virus infection; Vitamin b12 plasma level quantitative trait locus 1", "numrefs": 8, "title": "rs601338(A;A)", "genosummary": "resistance to Norovirus infection", "genobody": "This genotype confers genetic immunity to infection by the Norwalk norovirus, a major (and contagious) cause of acute gastroenteritis worldwide.", "repute": "Good", "tags": ["23andMe/SNPs", "ClinVar"], "effect": "resistance to Norovirus infection  This genotype confers genetic immunity to infection by the Norwalk norovirus, a major (and contagious) cause of acute gastroenteritis worldwide.", "magcolor": "#FF9090", "gmaf": 0.32419999999999999, "freq": 30.399999999999999, "chrom": "19", "rstext": "rs601338 is found on chromosome 19 in the alpha(1,2)-fucosyltransferase FUT2 gene. The wild-type rs601338(G) encodes the 'secretor' (Se) allele, while rs601338(A) encodes the 'non-secretor' (se) allele. A study of 115 Swedish adults concluded that rs601338(A;A) homozygotes have genetic immunity to infection by the Norwalk norovirus, a major (and contagious) cause of acute gastroenteritis worldwide among adults. This illness is also known as 'cruise ship gastroenteritis.' Being a non-secretor may have other consequences, such as greater susceptibility to infection by influenza viruses and by some types of bacteria. 23andMe discusses these topics. In some non-Caucasian populations, a different SNP is responsible for non-secretor phenotypes. For example, although the Se allele is absent in Ja...", "url": "http://www.snpedia.com/index.php/rs601338(A;A)", "rstime": 20140403070147, "geno": "(A;A)", "magnitude": 2.5, "gene": "FUT2"}]);

function Model (type) {
this._all = undefined;
this.other = {'start':'here'};


this.dump = function() {
   $.each(this._all, function(k,v) {
      console.log(v.title + v.repute+v.magnitude);
   });

};


this.loadRaw = function(allgenos) {
     this._all = allgenos;
};

this.setGeno = function(title, thedict) {
    var thethe = $.grep(this._all, function(p, i) {
         return ( p && p.title == title );
         });
     $.each(thedict, function (k,v) {
        thethe.forEach(function (x) {x[k] = v;});
     });
    };


this.setSort = function(thefunc) {
    //console.log('setting sort');
    this.other.sort = thefunc;
};
this.getSort = function() {
    //console.log('getting sort');
    return this.other.sort;
};
this.setFlag = function(key, value) {
    //console.log('really setting '+key+' = '+value);
    this.other[key] = value;
};
this.getFlag = function(key) {
//        console.log('getting '+key+' = ?');
    return this.other[key];
};



this.each = function (f) {
   doRev = model.getFlag('reverse');

   showGood = $('#filterGood');
   showBad = $('#filterBad');
   showNotSet = $('#filterNotSet');

   g = function(i, p) {
      if ((showGood   || !showGood   && p.repute == 'Good') &&
          (showBad    || !showBad    && p.repute == 'Bad') &&
          (showNotSet || !showNotSet && !p.repute))
         return f(i,p);
   };



   if (doRev) {
     return $.each(model._all.sort(model.getSort()).reverse(), f);
   } else {
     return $.each(model._all.sort(model.getSort()), f);
   }
};

}

function View (type) {
this.type = type;
this.color = "red";
this.getInfo = function() {
    return this.color + ' ' + this.type + ' apple';
};
}

function Controller (type) {
this.type = type;
this.color = "red";
this.getInfo = function() {
    return this.color + ' ' + this.type + ' apple';
};
}


var model = new Model();
model.loadRaw(mygenos);
